import React from "react";
import callIcon from "../../../assets/man/CusCall_navy.png";
import styles from "./BoxCall.module.css"; // Update the import path

const BoxCall = () => {
  return (
    <div className={styles.BoxCall}>
      <div className={styles.BoxCalltop}>
        <img className={styles.callIcon} src={callIcon} alt="아이콘" />
        <h1 className={styles.boxCallTitle}>통 화</h1>
      </div>

      <div className={styles.middle}>
        <div className={styles.middle_top}>03.04~03.10 기준</div>

        <div className={styles.middle_bottom}>
          <div className={styles.left_middle_bottom}>
            <div className={styles.smalltitle}>부재중 건</div>
            <div className={styles.smallnum}>34</div>
          </div>
          <div className={styles.right_middle_bottom}>
            <div className={styles.smalltitle}>일 TOTAL</div>
            <div className={styles.smallnum}>121</div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default BoxCall;
